      default: null,
    },
    generalDarkColor: {
      default: null,
    },
    generalWhiteColor: {
      default: null
    }
  },
  computed: {
    generalContrast() {
      if (this.generalContrastColor) {
        return this.generalContrastColor;
      } else {
        return getComputedStyle(document.documentElement).getPropertyValue(
          "--generalContrast"
        );
      }
    },
    generalBrand() {
      if (this.generalBrandColor) {
        return this.generalBrandColor;
      } else {
        return getComputedStyle(document.documentElement).getPropertyValue(
          "--generalBrand"
        );
      }
    },
    generalDark() {
      if (this.generalDarkColor) {
        return this.generalDarkColor;
      } else {
        return getComputedStyle(document.documentElement).getPropertyValue(
          "--generalColorDark"
        );
      }
    },
    generalWhite() {
      if (this.generalWhiteColor) {
        return this.generalWhiteColor;
      } else {
        return getComputedStyle(document.documentElement).getPropertyValue(
          "--generalColorWhite"
        );
      }
    }
  },
};
